data_1 = JSON.parse(data_1)
data_2 = JSON.parse(data_2)

let active_arrow = {
    id: 2,
    up: true
}

let pagination = {
    current: 2,
    perPage: 25
}

for (let i = 0; i < data_1.length; i++) {
    data_1[i].N = data_1[i].Name
    data_1[i].Name = "<a href=https://nces.ed.gov/collegenavigator/?id=" + data_1[i].UNITID + ">" + data_1[i].Name + "</a>"
}

for (let i = 0; i < data_2.length; i++) {
    data_2[i].Name = "<a href=https://nces.ed.gov/collegenavigator/?id=" + data_2[i].UNITID + ">" + data_2[i].Name + "</a>"

}

const filterUni = () => {
    var input, filter, table, tr, td, i, txtValue;
    input = document.getElementById("myInput");
    filter = input.value.toUpperCase();
    table = document.getElementById("uniTable");
    tr = table.getElementsByTagName("tr");
    for (i = 0; i < tr.length; i++) {
        td = tr[i].getElementsByClassName("tdItem")[0];
        if (td) {
            txtValue = td.textContent || td.innerText;
            if (txtValue.toUpperCase().indexOf(filter) > -1) {
                tr[i].style.display = "";
            } else {
                tr[i].style.display = "none";
            }
        }
    }
}

const paginateUni = (page, n = pagination.perPage) => {
    pagination.current = page
    let input, filter, table, tr, td, i, txtValue;
    input = document.getElementById("myInput");
    filter = input.value.toUpperCase();
    table = document.getElementById("uniTable");
    tr = table.getElementsByTagName("tr");
    for (let i = 0; i < tr.length; i++) {
        if (i < (page - 1) * 25 || i >= page * n) {
            td = tr[i].getElementsByClassName("tdItem")[0];
            if (td) {
                tr[i].style.display = "none";
            }
        } else {
            tr[i].style.display = ""
        }
    }
    genPageElements()
}

const loadValues = (data) => {
    let tbody = document.getElementById("uniTable")
    tbody.innerHTML = ""
    for (let i = 0; i < data.length; i++) {
        let tr = document.createElement("tr")
        let td0 = document.createElement("td")
        // Assigns University Name
        td0.innerHTML = data[i]["Name"]
        td0.className = "tdItem"
        tr.appendChild(td0)
        for (let j = 2; j < Object.keys(data[i]).length - 1; j++) {
            let keys = Object.keys(data[i])
            let td = document.createElement("td")
            td.className = "tdI2"
            td.innerHTML = data[i][keys[j]].toLocaleString('en-US', { style: 'currency', currency: 'USD' }).slice(0, -3)
            tr.appendChild(td)
        }
        tbody.appendChild(tr)
    }
}

const sortValues = (key, id) => {
    let lowToHigh = arrowClass(id)
    let data = data_1
    let arr
    if (key !== 'N') {
        if (lowToHigh) {
            arr = data.sort((a, b) => parseInt(a[key]) - parseInt(b[key]));
        } else {
            arr = data.sort((a, b) => parseInt(b[key]) - parseInt(a[key]));
        }
    } else {
        if (lowToHigh) {
            arr = data.sort((a, b) => b[key].localeCompare(a[key]));
        } else {
            arr = data.sort((a, b) => a[key].localeCompare(b[key]));
        }
    }
    loadValues(arr)
}

const arrowClass = (id) => {
    for (let i = 1; i < 8; i++) {
        let itemsUp = document.getElementById(i + "_" + "item_up")
        let itemsDown = document.getElementById(i + "_" + "item_down")
        itemsUp.className = "fas fa-long-arrow-alt-up"
        itemsDown.className = "fas fa-long-arrow-alt-down"
    }
    let up = false
    if (id != active_arrow.id || (id == active_arrow.id && active_arrow.up == false)) {
        up = true
    }
    active_arrow.id = id
    active_arrow.up = up
    if (up) {
        let arrow = document.getElementById(id + "_item_up")
        arrow.classList.add("activeArrow")
        return false
    } else {
        let arrow = document.getElementById(id + "_item_down")
        arrow.classList.add("activeArrow")
        return true
    }
}

// Element Generation

// Pagination Container

const genPageElements = () => {
    console.log("hit")
    let items = document.getElementById("uniTable").getElementsByTagName("tr").length
    let lastPage = Math.ceil(items / pagination.perPage)
    let c = document.getElementById("paginationContainer")
    c.innerHTML = ""
    // Lowest id passed is 1 to prevent paginating to zero
    gimmeArrows("❮❮", c, 1)
    gimmeArrows("❮", c, pagination.current - 1 > 1 ? pagination.current - 1 : 1)
    if (lastPage < 4) {
        for (let i = 0; i < lastPage; i++) {
            genPageBoxes(i)
        }
    } else {
        console.log(pagination.current)
        if (pagination.current > 1 && pagination.current < lastPage) {
            console.log(pagination.current)
            for (let i = -1; i < 2; i++) {
                genPageBoxes(pagination.current + i)
            }
        }
        if (pagination.current == 1 && pagination.current !== lastPage) {
        	for (let i = 1; i < 4; i++) {
        		genPageBoxes(i)	
        	}
        }
        if (pagination.current == lastPage) {
        	for (let i = lastPage - 2; i < lastPage + 1; i++) {
        		genPageBoxes(i)
        	}
        }
    }
    gimmeArrows("❯", c, pagination.current + 1 < lastPage ? pagination.current + 1 : lastPage)
    gimmeArrows("❯❯", c, lastPage)
}

const genPageBoxes = (n) => {
    console.log(n)
    let c = document.getElementById("paginationContainer")
    c.appendChild(gimmeBoxes(n))
}

const gimmeArrows = (content, element, id) => {
    let div = gimmeBoxes(id, content)
    element.appendChild(div)
}

const gimmeBoxes = (n, text) => {
    let div = document.createElement("div")
    div.className = "pageNumberContainer"
    div.id = text ? n + "_page_arrow" : n + "_page"
    div.onclick = function() { paginateUni(parseInt(this.id)) }
    let span = document.createElement("span")
    span.className = "pageNumber"
    // Custom text added if specified
    span.innerHTML = text ? text : n
    div.appendChild(span)
    if (pagination.current == n && !text) {
    	div.classList.add("activePage")
    }
    return div
}


sortValues("N", 1)
paginateUni(1)